import React, { useState } from 'react';

function SearchBox({ cars, onSearch }) {
  const [year, setYear] = useState('');
  const [make, setMake] = useState('');
  const [minPrice, setMinPrice] = useState('');
  const [maxPrice, setMaxPrice] = useState('');

  const handleClear = () => {
    setYear('');
    setMake('');
    setMinPrice('');
    setMaxPrice('');
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    onSearch(year, make, minPrice, maxPrice);
  };

  return (
    <div className="search-box-container">
      <form onSubmit={handleSubmit}>
        <div className="select-container">
          <label className="select-label">Year</label>
          <select
            className="select-menu"
            value={year}
            onChange={(e) => setYear(e.target.value)}
          >
            <option value="">Select Year</option>
            <option value="2022">2022</option>
            <option value="2021">2021</option>
            <option value="2020">2020</option>
          </select>
        </div>
        <div className="select-container">
          <label className="select-label">Make</label>
          <select
            className="select-menu"
            value={make}
            onChange={(e) => setMake(e.target.value)}
          >
            <option value="">Select Make</option>
            {/* Add options for car makes */}
          </select>
        </div>
        <div className="select-container">
          <label className="select-label">FOB Price</label>
          <div className="price-select-wrapper">
            <select
              className="select-menu price-select"
              value={minPrice}
              onChange={(e) => setMinPrice(e.target.value)}
            >
              <option value="">Min</option>
              <option value="1000">$1,000</option>
              <option value="5000">$5,000</option>
              <option value="10000">$10,000</option>
            </select>
            <div className="divider">~</div>
            <select
              className="select-menu price-select"
              value={maxPrice}
              onChange={(e) => setMaxPrice(e.target.value)}
            >
              <option value="">Max</option>
              <option value="10000">$10,000</option>
              <option value="50000">$50,000</option>
              <option value="100000">$100,000</option>
            </select>
          </div>
        </div>
        <div className="button-container">
          <button className="clear-button" type="button" onClick={handleClear}>
            Clear
          </button>
          <button className="search-button" type="submit">
            Search
          </button>
        </div>
      </form>
      <div className="car-collection">
        {cars.length > 0 ? (
          cars.map((car) => (
            <div key={car.id}>
              <h3>{car.make}</h3>
              <p>Year: {car.year}</p>
              <p>Price: {car.price}</p>
              {/* Add more car details as needed */}
            </div>
          ))
        ) : (
          <p>No cars found</p>
        )}
      </div>
    </div>
  );
}

export default SearchBox;
